import React from 'react';
import { View } from 'react-native';
import { TextInput, Title, Text, Button } from 'react-native-paper';
import SubmitButton from './SubmitButton.js';
import FormTextBox from './FormTextBox.js';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import './styles.css';

class Home extends React.Component{

    state = {
        username: '',
        password: ''
    };

    constructor() {
        super();
        this.attemptLogin = this.attemptLogin.bind(this);
    }

    render() {
        return(
            <div className="fullpage">
                <Container>
                    <Row className="main">
                        <Col md={{ span: 4, offset: 4 }}>
                            <Title>Welcome, Login!</Title>
                            <TextInput label='Username' value={this.state.username} onChangeText={username => this.setState({ username })} />
                            <TextInput label='Password' value={this.state.password} onChangeText={password => this.setState({ password })} />
                            <Button mode="contained" onClick={this.attemptLogin}>Login</Button>
                            <Text>{"Don't have an account?"}</Text>
                            <a href="">Create an account</a>
                        </Col>
                    </Row>
                </Container>
            </div>
        );
    }

    attemptLogin() {
        alert('pressed');
    }

}

export default Home;
